    [],nt"revision_timestamp": "2016-10-15T16:35:37.231441",nt"name": "moosehorn-national-wildlife-refuge-may-june-july-august-1949-narrative-report",nt"isopen":
    false,nt"url": null,nt"notes": "This narrative report for Moosehorn NWR
    outlines Refuge accomplishments from May through August of 1949. The report begins
    by summarizing the weather conditions and water conditions during this period. Wildlife-
    including migratory birds, upland game birds, big game animals, furbearers, predators,
    rodents, mammals, raptors, and fish- is also covered. The Refuge development and
    maintenance section discusses physical developments and collections and receipts.
    Resource management is outlined; topics include grazing, haying, and timber removal.
    A progress report on field investigations and applied research is also provided.
    The public relations section of the report describes recreational uses, Refuge visitors,
    and Refuge participation. N-R forms are attached.",nt"license_title": "License
